import React from 'react';
import './About.css';

const About = () => {
    return (
        <div className="about">
        <h2>About FitNet</h2>
        <p>FitNet is a social network for athletes and sports lovers. Connect with others who share your passion for sports, fitness, and an active lifestyle. Whether you're looking to find a workout partner, join sports events, or share your fitness journey, FitNet is the place for you!</p>
        <h3>Creators</h3>
        <ul>
            <li>Matan</li>
            <li>Reem</li>
            <li>Yarden</li>
            <li>Shiraz</li>
            <li>Moran</li>
        </ul>
    </div>
    );
};

export default About;
